import React from 'react'; 
import { Provider } from 'react-redux';
import store from './store';
import logo from './assets/logo.png';
import { Background } from './styles';
import Global from "./styles/global";
import Home from "./pages/Home/Home";

const data = [
  {
    id: Math.random(),
    title: "Box titulo 1",
    text: HTML,
    bgColor: "#D5CAFA"
  },
  {
    id: Math.random(),
    title: "Box titulo 2",
    text: CSS,
    bgColor: "#EDA9A9"
  },
  {
    id: Math.random(),
    title: "Box titulo 3",
    text: Javascript,
    bgColor: "#F2EE8D"
  },
  {
    id: Math.random(),
    title: "Box titulo 4",
    text: React,
    bgColor: "#9FEACD"
  }
];

export default function App() {
 return (
   <Provider store={store}>
     <Background>
           <div className="row">
        <div className="logo">
          <img src={logo} />
        </div>
      </div>
      <>
      <Global />
      <Home boxData={data} />
    </>
</Background>
  </Provider>


 );
}
